import React from 'react';
import './style.css'


const Banner = ({ pageTitle, subtitle }) => {
    return (
        <div className='banner'>
            <h2>{pageTitle}</h2>
            <h5>{subtitle} </h5>
        </div>
    );
}

export default Banner;
